import React from "react";
import HeaderImg from '../images/header_img.png';
import './He'

const Header = () => {
  return (
    <header className="header">
      <img
        className="header__image"
        src={HeaderImg}
        alt="облако цветное"
      />
    </header>
  );
};

export default Header;
